import React from 'react';
import './List.css';
import Card from'./Card.js';


function List(props){

    const cards = STORE.allCards.map((item) => <Card title={item.title} content={item.content}/>);

    return(<section className='List'>
        <header className='List-header'>
            <h2>{props.header}</h2>
        </header>
        <div className='List-cards'>
            {cards}
        </div>
        <button type='button' class="List-add-button">
            + Add Random Card
        </button>
    </section>)
}

export default List;
